import React from 'react';
import './Contact.css';

function ContactForm() {
    return (
        <div>
            <div className="contact-form-header">
            <div className="contact-section-line"></div>
            <h3 className="contact-section-title">Contact</h3>
            <div className="contact-section-line"></div>
        </div>
        </div>
    );
}

export default ContactForm;
